import React, { useState } from "react";

export default function NewExercise() {

    return (
        <tr>
            <td>
                <input placeholder='Bench Press'></input>
            </td>
            <td>
                <input placeholder='3'></input>
            </td>
            <td >
                <input placeholder='8-12'></input>
            </td>
        </tr>
    )
}
